import React from 'react';
import { UISref, UIRouter, UIView, pushStateLocationPlugin, servicesPlugin, UIRouterReact} from "@uirouter/react";

//OnsenUI
var Ons = require('onsenui');
var ROns = require('react-onsenui');

export default class extends React.Component {
    constructor(){
      super();
    }
  
    RenderMenu(){
        const refs = [
            <UISref key="main" to="app.main"> <ROns.ListItem tappable={true}>Главная </ROns.ListItem ></UISref>,
            <UISref key="main" to="app.categories"><ROns.ListItem tappable={true}> категории </ROns.ListItem ></UISref>,
            <UISref key="main" to="app.settings"><ROns.ListItem tappable={true}> настройки </ROns.ListItem ></UISref>,
        ]

        return refs;
    }

    render(){
      return (
    <ROns.Splitter>
    <ROns.SplitterSide
      width={200}>
      <ROns.Toolbar style={{'position': 'relative'}}>
            <div className="center"> Меню </div>
          </ROns.Toolbar>
   <ROns.List>
       {this.RenderMenu()}
   </ROns.List>
    </ROns.SplitterSide>

    <ROns.SplitterContent>
      <ROns.Page>
          <UIView />
      </ROns.Page>
    </ROns.SplitterContent>

    </ROns.Splitter>
      );
    }
  }
